import React, { useState, useEffect } from "react";
import axios from "axios";
function ChatPage() {
  const [chats, setChats] = useState([]);
  useEffect(() => {
    fetchChats();
  }, []);
  const fetchChats = () => {
    axios
      .get("/api/chat")
      .then((response) => setChats(response.data))
      .catch((err) => console.log(err));
  };
  return <div>CHAT</div>;
}

export default ChatPage;
